import React, { useState } from 'react';
import { BrowserRouter as Router, Route , Routes} from "react-router-dom";
import { Link } from "react-router-dom";

import Page1 from './page1'; 
import Page2 from './page2';
import Page3 from './page3';

import "../style/projectselector.css";
import "../style/pageselector_options.css";

function PageSelector() {

  return (
	  <body>
		  <div id="container">
			<a className="animated zoomInLeft box blue" href="/pokemondb/">Pokemon Database</a>
			<a className="animated zoomInRight box green" href="/page1/">Damage B</a>
			<a className="animated zoomInLeft box yellow" href="/page2/">Damage C</a>
		</div>
	  </body>
	
  );
}

export default PageSelector;
